import React from 'react';

import { FilterChips } from 'components';
import { withKnobs, text, boolean } from '@storybook/addon-knobs';
import { Box } from '@material-ui/core';

export default {
  title: 'FilterChips',
  component: FilterChips,
  decorators: [withKnobs],
};

export const Default = () => {
  const items = [
    { value: 'FOO', label: 'Product FOO' },
    { value: 'BAR', label: 'Product BAR' },
  ];
  return (
    <Box>
      <FilterChips
        items={items}
        handleRemoveItems={() => alert('Removed')}
        showRemoveAll={boolean('Show Remove All', false)}
        removeAllLabel={text('Remove All Label', 'remove all label text')}
      ></FilterChips>
    </Box>
  );
};
